import Card from 'react-bootstrap/Card';
import Row from 'react-bootstrap/Row';

function CardIndex({children}){
    return (
        <Card body>
            <Row 
                sm={{offset: 3}}
                lg={{offset: 3}}
                md={{offset: 3}}
            >
                {children}
            </Row>
        </Card>
    )
}
export default CardIndex;
